(function(){tinymce.create('tinymce.plugins.IBrowserPlugin',{init:function(ed,url){tinymce.ScriptLoader.load(url+'/interface/common.js');ed.addCommand('mceIBrowser',function(){var e=ed.selection.getNode();if(ed.dom.getAttrib(e,'class').indexOf('mceItem')!=-1)return;ib.isMSIE=tinymce.isIE;ib.isGecko=tinymce.isGecko;ib.oEditor=ed;ib.editor=ed;ib.selectedElement=e;ib.baseURL=url+'/ibrowser.php';iBrowser_open()});ed.addButton('ibrowser',{title:'iBrowser',cmd:'mceIBrowser',image:url+'/interface/images/tinyMCE/ibrowser.gif'})},getInfo:function(){return{longname:'iBrowser',author:'net4visions.com',authorurl:'http://net4visions.com',infourl:'http://net4visions.com',version:'1.3.8'}}});tinymce.PluginManager.add('ibrowser',tinymce.plugins.IBrowserPlugin)})();